window.bookSummaryJSON = "<p>\"The ideal presentation of any book of mine is to have excellent actors perform it in audio-only format.\" - Orson Scott Card </p> <p>This program is read by Stefan Rudnicki and a full cast including Emily Rankin, Kirby Heyborne, Orson Scott Card, P.J. Ochlan, Gabrielle de Cuir, Richard Gilliland, Kristoffer Tabori, and Judy Young. </p> <p>From Orson Scott Card, award-winning and Best-selling author of <i>Ender's Game</i>, his first solo Enderverse audiobook in years. </p> <p><i>Children of the Fleet</i> is a new angle on Card's Best-selling series, telling the story of the Fleet in space, parallel to the story on Earth told in the Ender's Shadow series. </p> <p>Ender Wiggin won the Third Formic war, ending the alien threat to Earth. Afterwards, all the terraformed Formic worlds were open to settlement by humans, and the International Fleet became the arm of the Ministry of Colonization, run by Hirum Graff. MinCol now runs Fleet School on the old Battle School station, and still recruits very smart kids to train as leaders of colony ships, and colonies. </p> <p>Dabeet Ochoa is a very smart kid. Top of his class in every school. But he doesn't think he has a chance at Fleet School, because he has no connections to the Fleet. That he knows of. At least until the day that Colonel Graff arrives at his school for an interview. </p> <p>Other Series by Orson Scott Card </p> <p>Ender </p> <p>#1 <i>Ender's Game</i> / #2 <i>Ender in Exile</i> / #3 <i>Speaker for the Dead</i> / #4 <i>Xenocide</i> / #5 <i>Children of the Mind</i> </p> <p>Ender's Shadow </p> <p>#1 <i>Ender's Shadow</i> / #2 <i>Shadow of the Hegemon</i> / #3 <i>Shadow Puppets</i> / #4 <i>Shadow of the Giant</i> / #5 <i>Shadows in Flight </i> </p> <p>The First Formic War (with Aaron Johnston) </p> <p>#1 <i>Earth Unaware</i> / #2 <i>Earth Afire</i> / #3 <i>Earth Awakens</i> </p>"; 
